INSERT INTO `dgn_message` VALUES (1,'2016-06-19 14:52:11','公告',6365657728920059911,'习近平主持召开中央全面深化改革领导小组第二十六次会议\n\n2016-07-22 20:26:00央视 分享\n　　央视网消息 (新闻联播)：中共中央总书记、国家主席、中央军委主席、中央全面深化改革领导小组组长习近平7月22日下午主持召开中央全面深化改革领导小组第二十六次会议并发表重要讲话。他强调，改革是一场革命，必须有坚韧不拔的毅力，以真抓促落实、以实干求实效。各地区各部门要以更大的决心和气力抓好改革督察工作，既要督任务、督进度、督成效，也要察认识、察责任、察作风，确保党中央确定的改革方向不偏离、党中央明确的改革任务不落空，使改革精准对接发展所需、基层所盼、民心所向。\n　　中共中央政治局常委、中央全面深化改革领导小组副组长李克强、刘云山、张高丽出席会议。\n　　会议审议通过了《贫困地区水电矿产资源开发资产收益扶贫改革试点方案》、《关于加强文化领域行业组织建设的指导意见》、《关于认罪认罚从宽制度改革试点方案》、《关于建立法官、检察官惩戒制度的意见(试行)》、《关于省以下环保机构监测监察执法垂直管理制度改革试点工作的指导意见》、《关于各地区各部门开展改革督察情况的报告》。\n　　会议指出，开展贫困地区水电矿产资源开发资产收益扶贫改革试点，是扶贫开发工作的重大制度创新。要以增加贫困人口资产性收益为目标，创新贫困地区水电矿产资源开发占用农村集体土地补偿方式，围绕界定入股资产范围、明确入股受益主体、合理设置股权、完善收益分配、加强股权管理和风险防控等重点任务，探索建立集体股权参与项目分红的资产收益扶贫长效机制，走出一条资源开发和脱贫攻坚有机结合的新路子。\n　　会议强调，加强文化领域行业组织建设，要坚持中国特色社会主义文化发展道路，始终把社会效益放在首位，坚持积极引导发展和严格依法管理并重，通过明确职能定位、做好培育发展、完善内部治理、强化规范管理等，健全党委统一领导、政府有效监管、分级负责、协调配合的行业组织管理体制机制，引导行业组织在服务文化企事业单位、服务广大文化工作者、服务行业发展、丰富群众文化生活等方面，更好发挥自身功能和独特优势，激发全社会文化创造活力。\n　　会议指出，完善刑事诉讼中认罪认罚从宽制度，涉及侦查、审查起诉、审判等各个诉讼环节，要明确法律依据、适用条件，明确撤案和不起诉程序，规范审前和庭审程序，完善法律援助制度。选择部分地区依法有序稳步推进试点工作。\n　　会议强调，建立法官、检察官惩戒制度，对落实法官、检察官办案责任制，促进法官、检察官依法行使职权，维护社会公平正义具有重要意义。要坚持党管干部原则，尊重司法规律，体现司法职业特点，坚持实事求是、客观公正、坚持责任和过错相结合，坚持惩戒和教育相结合，规范法官、检察官惩戒的范围、组织机构、工作程序、权利保障等，发挥惩戒委员会在审查认定方面的作用。\n　　会议指出，开展省以下环保机构监测监察执法垂直管理制度改革试点，目的是建立健全条块结合、各司其职、权责明确、保障有力、权威高效的地方环保管理体制，确保环境监测监察执法的独立性、权威性、有效性。要强化地方党委和政府及其相关部门的环境保护责任，注意协调处理好环保部门统一监督管理和属地主体责任、相关部门分工负责的关系，规范和加强地方环保机构和队伍建设，建立健全高效协调的运行机制。\n　　会议强调，开展改革督察工作，要明确工作重点、盯住关键环节。督任务，就是要督促地方和部门按照党中央要求谋划改革任务，既看方向准不准，又看任务实不实，是不是能够结合实际，真正解决问题。督进度，就是要根据改革的阶段性目标和时间表、路线图，既督促改革方案及时出台、抓紧落实，又督察相关改革任务配套跟进，抓好进度统筹，加强政策衔接。督成效，就是要把改革举措放到实践中去检验，让基层来评判，让群众来打分，看改革是否促进了经济社会发展，是否促进社会公平正义，是否给人民群众带来获得感。察认识，就是要看思想工作有没有做深入，广大党员、干部特别是领导干部有没有从党和国家工作大局出发认识和理解改革、关心和支持改革，是不是自觉站在改革全局高度正确看待局部利益关系调整，形成推进改革的思想自觉和行动自觉。察责任，就是要看改革主体责任是不是划分清楚，有没有理解到位、落实到位，是不是做到了各司其职、各负其责又相互协作。察作风，就是要对照“三严三实”要求，督察各级干部特别是领导干部是不是坚持实事求是、求真务实，是不是以改革促进派、实干家的标准要求自己，以严和实的作风谋划改革、落实改革。\n　　会议指出，当前和今后一个时期，要按照把改革主体框架搭建起来这一阶段性目标，排出督察优先顺序，聚焦重点难点。要抓问题要害，做到眼睛向下、脚步向下，既要发现实施中的共性问题，也要关注群众反映强烈的热点难点问题，找出症结，提出对策。要抓整改落实，督促真抓真改，对改革抓得实、有效果的要表扬，对执行不力、落实不到位的要问责追责。要抓统筹联动，完善督察职能，发挥社会和群众监督作用，做到上下贯通、内外结合。\n　　中央全面深化改革领导小组成员出席，中央和国家有关部门负责同志列席会议。',6365657728920059911,'习近平主持召开中央全面深化改革领导小组第二十六次会议',0,'',878787,0);
