CREATE DEFINER=`root`@`localhost` PROCEDURE `dgn_GetCustGoods`(varCustomerID bigint unsigned,varSearchStr varchar(200),varPageSize int,varCurPage int)
BEGIN
 declare varstartPage int unsigned;
 
set varstartPage=(varCurPage-1) * varPageSize;
 select a.*,case when c.compid is null then a.DefaultPrice  else b.Price end as Price  from dgn_goods a
 left join dgn_goods_price b on a.goodsid=b.goodsid 
 left join dgn_company c on c.compcategory=b.customertype and  c.comptype='6365673372633792535' and c.compid=varCustomerID 
 where  a.goodscode  like varSearchStr  or a.goodsname like  varSearchStr  or a.barcode like  varSearchStr 
 limit varstartPage,varPageSize  ;
END ;;
