CREATE DEFINER=`root`@`localhost` PROCEDURE `dgn_GetMobileGoodsList`(varUserID bigint unsigned,varLng float(10,7),varLat float(10,7),vardistance int unsigned,varPageSize  mediumint unsigned,varcurPage int unsigned)
BEGIN

declare varstartPage int unsigned;
set varstartPage=varcurPage * varPageSize;

	select a.ID,a.GoodsID,a.GoodsName,a.Price,a.TradePrice,a.DiscountPrice,a.GoodsDescribe
		,a.GoodsLabel,a.CompID,b.CompName ,b.CompAddr,b.IsShangMen,b.IsDaoDian
		, getDistance(b.Longitude,b.Latitude,varLng,varLat) as distanceMi,d.ImageFileName
		from dgn_goods a 
		inner join dgn_shop b on a.ShopID=b.ShopID
		left join ( select FormID,max(fileid) as MaxFileID from  dgn_upload_file group by FormID  ) c on a.ProductImages=c.FormID
		left join dgn_upload_file_images d on c.MaxFileID=d.FileID and d.ImageType=0 
		HAVING distanceMi <= vardistance ORDER BY distanceMi   LIMIT varstartPage , varPageSize ;
END ;;
