CREATE DEFINER=`root`@`localhost` PROCEDURE `dgn_GetPersonList`(varUserID bigint unsigned,varPageSize  mediumint unsigned,varcurPage int unsigned,varFilterStr nvarchar(4000))
BEGIN

declare varstartPage int unsigned;
declare varTotalSize int unsigned;
 
 
set varstartPage=(varcurPage-1) * varPageSize;

	select  count(1) into varTotalSize from dgn_person  ;
 
set @varSqlStr=concat(
	'select a.*,d.ImageFileName,',varTotalSize,' as   TotalSize
		from dgn_person a 
		left join ( select FormID,max(fileid) as MaxFileID from  dgn_upload_file where FileType=\'img\' group by FormID  ) c on a.UserImages=c.FormID
		left join dgn_upload_file_images d on c.MaxFileID=d.FileID and d.ImageType=0 
        where  1=1 ',ifnull(varFilterStr,''),' LIMIT ',varstartPage,',', varPageSize);
         PREPARE psql FROM @varSqlStr;  
		 EXECUTE psql ;  
END ;;
