CREATE DEFINER=`root`@`localhost` PROCEDURE `dgn_UploadImg`(varUserID bigint(20),varSrcFileName varchar(200),varNewFilePath varchar(100),varNewFileName varchar(100),varIsWatermark tinyint(1),varFormID bigint(20) ,varImgWidth int,varImgHeight int)
label_exit: BEGIN
 
     declare varFileID bigint(20);
     declare filename,tfilename,wfilename nvarchar(300);

     set varFileID=uuid_short();
     set filename=concat( varNewFilePath,'/'  ,varNewFileName);
     set tfilename=concat( varNewFilePath,'/t_' ,varNewFileName);
     set wfilename=concat( varNewFilePath,'/w_'  ,varNewFileName);
      insert into dgn_upload_file(FormID,FileID,UploadFileName,NewFileName,UploadUserID,UploadTime,FileType,Width,Height)
