    if  varIsWatermark=1 then
      insert into dgn_upload_file_images(FileID,ImageType,ImageFileName)
       select varFileID,2,wfilename;
    
    end if;
     
       select 'success' as result,'上传成功' resultDescribe, varFileID as FileID,tfilename as thumbUrl,filename as FileUrl,varImgWidth as width,varImgHeight as height ;
   
      
