CREATE DEFINER=`root`@`localhost` PROCEDURE `dgn_UserIsLogged`(varAppID varchar(50),varUserID bigint,varAccessToken varchar(50))
BEGIN
	if exists
	 (select 1 from dgn_access_token where userid=varUserID  and AppID=varAppID and AccessToken=varAccessToken  and now()<=ExpireTime )
    then
		select 0 as result,'已登录' resultDescribe;
	else
		select 1 as result,'未登录' resultDescribe;
    end if ;
END ;;
